domain_model.plantuml:
@startuml

class System {
  - multiProcessingCapable: boolean
  - nearRealTimeCapable: boolean
  + serviceTrigger(trigger: Trigger): void
  + sendNotification(notification: Notification): void
  + recordMessage(message: Message): void
  + addRecipe(recipe: Recipe): void
}
class Database {
  - transactionRatePerMinute: int
  + handleTransactions(): void
  + failOver(): void
}
class Backup {
  - onsiteFrequency: String
  - offsiteFrequency: String
  + performBackup(): void
}
class NetworkInterface {
  - wiredEthernetSpeed: String
  - cabling: String
}
class SANDevice
class VideoRecorder {
  - maxSimultaneousShows: int
  + recordShow(show: TVShow): void
}
class Trigger {
  - timestamp: Date
}
class Notification {
  - message: String
  - type: String
}
class WaterPurificationSystem
class FiltrationRecord {
  - date: Date
  - volume: double
}
class WaterSoftenerSystem
class SaltMonitor {
  - currentLevel: double
  + acceptUserSetting(desiredLevel: double): void
}
class AirQualityMonitor {
  - currentQuality: double
  + acceptThreshold(threshold: double): void
}
class SmokeDetector {
  - manufacturerSetting: double
  - userThreshold: double
  + triggerWarning(): void
}
class CarbonDioxideDetector {
  - manufacturerSetting: double
  - userThreshold: double
  + triggerWarning(): void
}
class RadonDetector {
  - ceilingLevel: double
  + activateFan(): void
  + recordLevel(): void
}
class Zone {
  - name: String
  - desiredTemperatureSettings: Double
  - periodsInDay: Integer
  + setTemperatureForPeriod(period: String, temperature: double): void
}
class TemperatureSetting {
  - unoccupiedTemperature: double
}
class MotionDetector {
  - differentiatesPets: boolean
  + detectOccupancy(): boolean
}
class Window {
  - pathObstacle: boolean
  + reverseIfResistance(): void
}
class IrrigationAccessPoint {
  - desiredMoisture: double
  + defineWateringInterval(interval: String): void
}
class SoilMoistureDetector {
  - moistureLevel: double
}
class RainWaterRecoverySystem {
  - monthlyVolume: double
}
class EnergyInterface {
  - sourceType: String
}
class AirFlowMonitor {
  - flowRate: double
}
class DoorLock {
  - type: String
  + encodeOneTimeCode(code: String): void
}
class GarageDoor {
  - maxOpenDuration: int
  + overrideHoldOpen(): void
}
class Camera {
  - location: String
}
class DVRSystem {
  + queueRecording(show: TVShow): void
}
class TVShow {
  - title: String
}
class Recording {
  - quality: String
}
class VideoMetadata {
  - category: String
  - genre: String
  - title: String
  - rating: String
  + updateMetadata(metadata: Map<String,String>): void
}
class AudioLibrary {
  + normalizeVolume(): void
}
class Playlist {
  - name: String
  - description: String
  + addTrack(track: Track): void
}
class Track
class PetWaterBowl {
  - dailyConsumption: double
}
class LitterBox {
  - odorLevel: double
  - disposalUnitFull: boolean
}
class WeightPad {
  - weight: double
}
class VaccinationRecord {
  - type: String
  - dateAdministered: Date
}
class CoffeeMaker {
  - beanLevel: double
  + startAtTime(time: Date): void
}
class HotTub {
  - waterTemperature: double
  + administerChemicals(): void
}
class Message {
  - date: Date
  - timeStamp: Time
  - phoneNumber: String
}
class Recipe {
  - categories: String
}

System "1" o-- "1..*" Database
Database -- Backup
System "1" o-- "1..*" NetworkInterface
System "1" o-- "0..1" SANDevice
System "1" o-- "0..1" VideoRecorder
System "1" *-- "1" WaterPurificationSystem
WaterPurificationSystem *-- "0..*" FiltrationRecord
System "1" *-- "1" WaterSoftenerSystem
WaterSoftenerSystem *-- "1" SaltMonitor
System "1" o-- "1" AirQualityMonitor
System "1" o-- "1" SmokeDetector
System "1" o-- "1" CarbonDioxideDetector
System "1" o-- "1" RadonDetector
System "1" *-- "1..*" Zone
Zone *-- "1" TemperatureSetting
System "1" o-- "1..*" MotionDetector
System "1" o-- "1..*" Window
System "1" *-- "1..*" IrrigationAccessPoint
IrrigationAccessPoint o-- "1" SoilMoistureDetector
System "1" o-- "1" RainWaterRecoverySystem
System "1" o-- "1" EnergyInterface
System "1" o-- "1..*" AirFlowMonitor
System "1" *-- "1..*" DoorLock
System "1" *-- "1" GarageDoor
System "1" *-- "1..*" Camera
System "1" *-- "1" DVRSystem
DVRSystem o-- "0..*" TVShow
DVRSystem *-- "0..*" Recording
Recording o-- "1" VideoMetadata
System "1" *-- "1" AudioLibrary
AudioLibrary *-- "0..*" Playlist
Playlist *-- "1..*" Track
System "1" *-- "0..*" PetWaterBowl
System "1" *-- "0..*" LitterBox
System "1" o-- "0..1" WeightPad
System "1" *-- "0..*" VaccinationRecord
System "1" *-- "1" CoffeeMaker
System "1" *-- "1" HotTub
System "1" o-- "0..*" Message
System "1" o-- "0..*" Recipe

@enduml
